var React = require('react-native');
var {
  StyleSheet,
} = React;

module.exports = StyleSheet.create({
  container: {
    flex: 1,
  },
  searchContainer: {
    flexDirection: "row",
    height: 72,
    borderBottomColor: "#fff",
    paddingTop: 100
  },
  search: {
    flex: 1,
    flexDirection: "row",
    height: 40,
    borderRadius: 6,
    backgroundColor: "yellon"
  },
  cancelSearch: {
    position: "absolute",
    marginHorizontal: 16,
    textAlign: "center",
    justifyContent: "center",
    alignSelf: "center"
  },

  list: {
    padding: 20,
  },

  productsTitle: {
    fontSize: 15,
    color: '#DA552F'
  },


  search: {
    height: 40,
    borderColor: '#DA552F',
    borderWidth: 1,
    color: '#DA552F',
  },

  productsContainer: {
    borderColor: '#DDD',
    borderRadius: 5,
    padding: 20,
    flex: 1,
    marginBottom: 20,
  },

  productsDescription: {
    fontSize: 16,
    color: '#999',
    marginTop: 5,
    lineHeight: 24,
  },

  productsButton: {
    height: 42,
    borderRadius: 5,
    borderWidth: 2,
    borderColor: '#DA552F',
    backgroundColor: 'transparent',
    justifyContent: 'center',
    alignItems: 'center',
    marginTop: 10,
  },

  productsButtonText: {
    fontSize: 16,
    color: '#DA552F',
    fontWeight: 'bold',
  },
});
